snippet.description:
Ze is al gecoverd dit seizoen van The Voice, maar nu brengt de enige echte Dua Lipa zelf het wereldnummer "Be The One"!

// ABONNEREN //
Vergeet je niet abonneren op het YouTube-kanaal van 'The Voice van Vlaanderen' en bekijk de nieuwe optredens als eerste:
http://www.youtube.com/c/TheVoicevanVlaanderen?sub_confirmation=1

// WEBSITE //
Ga voor meer informatie en de volledige aflevering naar onze website: http://thevoice.vtm.be/

// SOCIAL MEDIA //
Facebook : http://www.facebook.com/TheVoiceVanVlaanderen
Twitter : http://www.twitter.com/VTMTheVoice

// OVER DE SHOW //
Een unieke en pure stem die je omverblaast, daar draait het om in The Voice van Vlaanderen. Koen Wauters en Bent Van Looy zijn opnieuw van de partij als coach en krijgen het gezelschap van Bart Peeters en Natalia Druyts. Ze hebben alle vier 1 doel voor ogen: na zes Blind Auditions selecteren ze elk 12 talenten hebben voor hun team, die ze weken lang begeleiden aan de hand van hun eigen ervaring in hun prille muziekcarrière.

